import React from "react";
import "./Nav.css";
import github from "./images/github-logo.png";

function Nav() {
  return (
    <div className="Nav">
      <img src={github} className="Github" alt="github"></img>

      <div className="links">
        <li>About Me</li>
        <li>Projects</li>
        <li>Resume</li>
        <li>Contact</li>
      </div>
    </div>
  );
}

export default Nav;
